import './App.css';
import User from './users/pages/User'
import {BrowserRouter as Router,Route,Redirect} from 'react-router-dom';

function App() {
  return <Router>
    <switch />
    <Route path="/" exact>
    <User />
    </Route>

   <Redirect to="/"/>
  </Router>
}

export default App;
